export default function App() {
  return (
    <div className="container">
      <div className="card">
        <h1> Apps</h1>
        <hr class="firsthr" />
        <Listapp />
      </div>
    </div>
  );
}
function Listapp() {
  return (
    <div className="app">
      <div className="first one-name">
        <i
          className="fa-brands fa-slack fa-spin-pulse"
          style={{ color: "#63E6BE" }}
        ></i>
        <p>Slack</p>
      </div>

      <div class="second one-name">
        <i class="fa-brands fa-trello" style="color: #74C0FC;"></i>
        <p>Trello</p>
      </div>
    </div>
  );
}
